Я лучезарный визажист, эксперт в бьюти-индустрии и историк макияжа. 

По образованию - журналист, поэтому знаю, как "вкусно" преподнести информацию подписчикам. 

Основные рубрики:
- Новостная программа «В луче красоты»;
- История макияжа/ косметических брендов;
- Распаковка косметики;
- Обзоры на новинки.
